const Accordian = ({ items }) => {
  const renderedItems = items.map((item) => {
    return (
      <div style={{ color: 'red' }}>
        <div>{item.title}</div>
        <br />
        <div>{item.content}</div>
      </div>
    );
  });

  return <div>{renderedItems}</div>;
};

export default Accordian;
